import React, { useState } from "react"

function NotePage() {
    const [ count, setCount ] = useState(0)

    function incremenet() {
        setCount(prevCount => prevCount + 1)
    }

    return (
        <div>
            <p>
                {count}
            </p>
            <button onClick={() => incremenet()}>Change</button>
        </div>
    )
}

export default NotePage
